dna = ''
gene=[]
for n in range(0, len(dna), 3):
    gene.append(dna[n:n+3])

codon={}
with open("codon.txt") as f1:
    for line in f1:
        n = line.strip().split()
        codon[n[0]] = n[1]
        codon[n[2]] = n[3]
        codon[n[4]] = n[5]
        codon[n[6]] = n[7]

protein=[]
for c in gene:
    protein.append(codon[c])
    
print(''.join(protein))
